import { withOktaAuth } from '@okta/okta-react';
import React from 'react';


export default withOktaAuth(class Login extends React.Component {

    constructor(props) {
        super(props);
        this.login = this.login.bind(this);

    }

    async login() {
        this.props.authService.login('/profile');
    }

    render() {
        return(
            <div>Login</div>
        )
    }

})
